m/pic/upload/vod/2017-04-19/201704191492566350.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">9.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">13集全</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/16206/">焦急的罗曼史</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E6%88%90%E5%8B%8B------------/" target="_blank">成勋</a>&nbsp;<a href="/s/-%E5%AE%8B%E6%99%BA%E6%81%A9------------/" target="_blank">宋智恩</a>&nbsp;<a href="/s/-%E9%87%91%E5%AE%B0%E8%8B%B1------------/" target="_blank">金宰英</a>&nbsp;<a href="/s/-%E6%9E%97%E5%BA%A6%E5%85%81------------/" target="_blank">林度允</a>&nbsp;<a href="/s/-%E9%84%AD%E5%A4%9A%E7%91%9F------------/" target="_blank">鄭多瑟</a>&nbsp;<a href="/s/-%E6%9D%8E%E6%B5%B7%E4%BB%81------------/" target="_blank">李海仁</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E5%A7%9C%E5%93%B2%E5%AE%87--------/" target="_blank">姜哲宇</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/15/" target="_blank">日韩剧</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%9F%A9%E5%9B%BD-----------/" target="_blank">韩国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2017/" target="_blank">2017</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>　　《My Secret Romance》是100%事前製作的电视剧，剧情描述因一夜情相遇的两名男女，在三年后以工作狂本部长与公司餐厅新任营养师的身分重逢而展开的故事此外，《My Secret Romance》的原著小说已经在线上公开，并得到许多读者的喜爱，因此更令人期待电视剧是否也能同样得到观眾的</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/16206/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/60285/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2018-09-26/201809261537942890.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">7.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">中文字幕</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/60285/">卑劣的罗曼史</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-Oscar------------/" target="_blank">Oscar</a>&nbsp;<a href="/s/-G%C3%A9nova------------/" target="_blank">Génova</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----Jos%C3%A9--------/" target="_blank">José</a>&nbsp;<a href="/s/-----Campusano--------/" target="_blank">Campusano</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%85%B6%E5%AE%83-----------/" target="_blank">其它</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2008/" target="_blank">2008</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>罗伯托是个年轻的同志男孩，每天他都在别人的床上醒来，为了方便母亲和姐姐在家接客，无处容身的罗伯托只能成日在街头闲晃罗伯托与劳尔的关系开始于街头搭讪，这个50多岁的男人邀请罗伯托去了自己家里。每一次劳尔的性爱都强硬而粗暴，之后，罗伯托在劳尔家安顿了下来，而劳尔时常的彻夜不归打破了两人表面上的相安无事。</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/60285/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/57699/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2018-08-07/201808071533630673.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">1.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD1280韩语中字</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/57699/">罗曼史：妈妈的朋友</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%EC%9D%B4%EC%9D%80%EB%AF%B8------------/" target="_blank">이은미</a>&nbsp;<a href="/s/-%EB%B0%95%EC%A3%BC%EB%B9%88------------/" target="_blank">박주빈</a>&nbsp;<a href="/s/-%EC%9C%A0%EC%84%A4%EC%95%84------------/" target="_blank">유설아</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%EC%9C%A0%ED%95%B4%EC%A2%85--------/" target="_blank">유해종</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%9F%A9%E5%9B%BD-----------/" target="_blank">韩国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2018/" target="_blank">2018</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>男主跟自己的好友两人对性爱非常感兴趣，但是却都没有体验过，男主家中突然搬来了一个美丽的单身姨母，男主将她当做了意淫对象，常常幻想她来打飞机，而终于有一次被姨母撞见，姨母不但没有生气，还愿意教男主如何做爱.....男主的好友一直想勾引学生妹来上床，也总是被拒绝，伤心绝望之际，突然收到了一个女生的相约，</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/57699/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/23181/" data-original="http://pic.youku778.com/upload/vod/2019-01-17/15476611138.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">8.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">32</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/23181/">生死决断罗曼史</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E6%B1%A0%E8%B4%A4%E5%AE%87------------/" target="_blank">池贤宇</a>&nbsp;<a href="/s/-%E6%9D%8E%E8%AF%97%E8%8B%B1------------/" target="_blank">李诗英</a>&nbsp;<a href="/s/-%E9%87%91%E6%8C%AF%E7%83%A8------------/" target="_blank">金振烨</a>&nbsp;<a href="/s/-%E5%B0%B9%E5%91%A8%E7%86%99------------/" target="_blank">尹周熙</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E6%9D%8E%E6%98%8C%E7%BF%B0--------/" target="_blank">李昌翰</a>&nbsp;<a href="/s/-------------/" target="_blank"></a>&nbsp;</l